use std::collections::{HashMap, BinaryHeap}; #[derive(Eq,PartialEq)]
struct Counter(i32,i32); impl Ord for Counter { fn cmp(&self, other: &Self) -> std::cmp::Ordering{ other.1.cmp(&self.1) }
} impl PartialOrd for Counter { fn partial_cmp(&self, other: &Self) -> Option<std::cmp::Ordering>{ Some(other.1.cmp(&self.1)) }
} impl Solution { pub fn top_k_frequent(nums: Vec<i32>, k: i32) -> Vec<i32> { let k = k as usize; let mut counterMap = HashMap::new(); nums.into_iter().for_each( |n| { let mut count = counterMap.get_mut(&n); if count.is_none(){ counterMap.insert(n,1); }else{ *count.unwrap() += 1; } } ); let mut min_heap = BinaryHeap::new(); counterMap.into_iter().for_each( |(key,val)| { min_heap.push(Counter(key,val)); if min_heap.len() > k { min_heap.pop(); } } ); return min_heap.into_iter().rev().map(|Counter(v,_)| v ).collect::<Vec<i32>>(); }
}

