public: bool evaluateTree(TreeNode* root) { int val = root->val; if ( val == 0 ) return false; else if (val == 1) return true; else if (val == 2) return evaluateTree(root->left) || evaluateTree(root->right); else return evaluateTree(root->left) && evaluateTree(root->right); }
};

